html {
    background: #242424 !important;
}

.navbar ul {
    background: #181818 !important;
}

.navbar li.active {
    background: #EBB483 !important;
}

.navbar li a {
    color: #F4F4F4 !important;
}

.navbar li:hover {
    background: #EBB483 !important;
}

.navbar a:hover {
    color: #242424 !important;
}

.dropdown-content {
    background: #242424 !important;
    box-shadow: unset !important;
}

.content {
    filter: invert(100%) !important;
}

.bk-toolbar-button {
    filter: invert(100%) !important;
}

